import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Exercice1 from './components/Exercice/exos/Exo1';
import Result from './components/Listes/Result';
import FilmItem from './components/Exercice/exos/Exo2';
import Calculatrice from './components/Exercice/calculatrice/calculatrice';
import TpCart1 from './components/Exercice/TP Carte/TpCarte1';
import TpCart2 from './components/Exercice/TP Carte/TpCarte2';
import ListUser from './components/Exercice/Tpredux/Liste';
import Add from './components/Exercice/Tpredux/Ajout';
const Stack = createStackNavigator();

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Accueil">
        <Stack.Screen name="Accueil" component={ListUser} /> 
        <Stack.Screen name="Product Navigation" component={FilmItem} /> 
        <Stack.Screen name="Product Details" component={Result} /> 
        <Stack.Screen name='TpCarte2' component={TpCart2}/>
        <Stack.Screen name='add user' component={Add}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
